You can change the background color of an Adaptive Card by adding a `background` property to the card's container. Here's an example:
```json
{
  "type": "AdaptiveCard",
  "version": "1.0",
  "background": "#FF0000", // red background color
  "body": [
    {
      "type": "TextBlock",
      "text": "Hello World!"
    }
  ]
}
```
Alternatively, you can use a `style` property to define a custom style for the card, like this:
```json
{
  "type": "AdaptiveCard",
  "version": "1.0",
  "style": {
    "backgroundColor": "#FF0000" // red background color
  },
  "body": [
    {
      "type": "TextBlock",
      "text": "Hello World!"
    }
  ]
}
```
Make sure to update the Adaptive Card Designer to the latest version, as this feature might not be available in older versions.

